using System;
using System.Diagnostics;
using System.IO;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace HomeworkKovshov1
{
    [TestClass]
    public class UnitTest
    {
        private static readonly Stopwatch StopWatch = new Stopwatch();
        public TestContext TestContext { get; set; }

        private static void Clean()
        {
            if (File.Exists(Permutation.Input))
            {
                File.Delete(Permutation.Input);
            }

            if (File.Exists(Permutation.Output))
            {
                File.Delete(Permutation.Output);
            }
        }

        private static void WriteToInputFile(string text)
        {
            var streamWriter = new StreamWriter(Permutation.Input);
            streamWriter.WriteLine(text);
            streamWriter.Close();
        }

        private static string ReadFromOutputFile()
        {
            var streamReader = new StreamReader(Permutation.Output);
            var result = streamReader.ReadLine();
            streamReader.Close();
            return result;
        }

        private void Execute(string input)
        {
            Clean();
            WriteToInputFile(input);
            StopWatch.Reset();
            StopWatch.Start();
            new Permutation().Run();
            StopWatch.Stop();
            TestContext.WriteLine("Time: " + StopWatch.Elapsed.TotalSeconds);
        }

        private void ExecuteAndCheckTrue(string input)
        {
            Execute(input);
            Assert.AreEqual(bool.TrueString, ReadFromOutputFile());
        }

        private void ExecuteAndCheckFalse(string input)
        {
            Execute(input);
            Assert.AreEqual(bool.FalseString, ReadFromOutputFile());
        }

        [TestMethod]
        public void TestNumberPositive()
        {
            ExecuteAndCheckTrue("0123456789\n4109725836");
        }

        [TestMethod]
        public void TestNumberNegative()
        {
            ExecuteAndCheckFalse("2093817645\n971682543");
        }

        [TestMethod]
        public void TestRusLettersPositive()
        {
            ExecuteAndCheckTrue("абвгдеёжзийклмнопрстуфхцчшщъыьэюя\nёкшуцтгыюйьхлаясъщчинзопбдвжэефмр");
        }

        [TestMethod]
        public void TestRusLettersNegative()
        {
            ExecuteAndCheckFalse("лаюёврмчукходгежйитзъшысяцэфбнпьщ\nепбщешюумнжортялчихысцфдгйъкэзьва");
        }

        [TestMethod]
        public void TestEngLettersPositive()
        {
            ExecuteAndCheckTrue("abcdefghijklmnopqrstuvwxyz\nygvmecfaorjqhdwtilpuksxbnz");
        }

        [TestMethod]
        public void TestEngLettersNegative()
        {
            ExecuteAndCheckFalse("joplshtfrnieucdwgmkvqbzaxy\nhziqtxfbcwnslkeygourdamvpi");
        }

        [TestMethod]
        public void TestSpecialСharactersPositive()
        {
            ExecuteAndCheckTrue("! №;%:?*()_+=-\'\"\t\n)+*=-\t%_: №?;\"(\'!");
        }

        [TestMethod]
        public void TestSpecialСharactersNegative()
        {
            ExecuteAndCheckFalse("! №;%:?*()_+=-\'\"\t\n)+*=-\t%_:№?;\"(\'!");
        }

        [TestMethod]
        public void TestLettersInUpperAndLowerCasePositive()
        {
            ExecuteAndCheckTrue("АБВгдеABCdef\neАБВдгеABdCf");
        }

        [TestMethod]
        public void TestLettersInUpperAndLowerCaseNegative()
        {
            ExecuteAndCheckFalse("АБВгдеABCdef\nабвГДЕabcDEF");
        }

        [TestMethod]
        public void TestBigInputPositive()
        {
            ExecuteAndCheckTrue(
                "" +
                "\n" +
                "");
        }

        [TestMethod]
        public void TestBigInputNegative()
        {
            ExecuteAndCheckFalse(
                "" +
                "\n" +
                "");
        }

        [TestMethod]
        [ExpectedException(typeof(InputFirstLineException))]
        public void TestEmptyFirstLine()
        {
            Exception exception = null;
            Clean();
            var streamWriter = new StreamWriter(Permutation.Input);
            streamWriter.Close();
            StopWatch.Reset();
            StopWatch.Start();
            try
            {
                new Permutation().Run();
            }
            catch (Exception e)
            {
                exception = e;
            }

            StopWatch.Stop();
            TestContext.WriteLine("Time: " + StopWatch.Elapsed.TotalSeconds);
            if (exception != null) throw exception;
        }

        [TestMethod]
        [ExpectedException(typeof(InputSecondLineException))]
        public void TestEmptySecondLine()
        {
            Exception exception = null;
            Clean();
            WriteToInputFile("first line");
            StopWatch.Reset();
            StopWatch.Start();
            try
            {
                new Permutation().Run();
            }
            catch (Exception e)
            {
                exception = e;
            }

            StopWatch.Stop();
            TestContext.WriteLine("Time: " + StopWatch.Elapsed.TotalSeconds);
            if (exception != null) throw exception;
        }

        [TestMethod]
        [ExpectedException(typeof(InputFileNotExistException))]
        public void TestInputFileAbsent()
        {
            Exception exception = null;
            Clean();
            StopWatch.Reset();
            StopWatch.Start();
            try
            {
                new Permutation().Run();
            }
            catch (Exception e)
            {
                exception = e;
            }

            StopWatch.Stop();
            TestContext.WriteLine("Time: " + StopWatch.Elapsed.TotalSeconds);
            if (exception != null) throw exception;
        }
    }
}